"146203":{"id":"146203","name":"O Último Exorcismo: Parte II","slug":"o-ultimo-exorcismo-parte-ii","original_title":"The Last Exorcism Part II","overview":"Após escapar do ritual realizado por um culto, que desejava que ela desse a luz a um filho demoníaco, a jovem Nell Sweetzer (Ashley Bell) é encontrada suja e completamente aterrorizada na floresta. Apesar de ser examinada por uma equipe médica, Nell não se lembra bem do que lhe aconteceu. Ela decide se mudar para a pequena cidade de Davreaux, onde tenta recomeçar a vida em um lar para garotas abandonadas. Entretanto, não demora muito para que o demônio Abalam volte a atormentá-la. Desta vez, Nell poderá contar com uma poderosa equipe de exorcistas, que conhecem as técnicas mais avançadas para livrá-la de uma vez por todas desse mal.","first_air_date":"2013-02-28","runtime":88,"episode_run_time":[88],"vote_average":4.6,"created_by":["CBS Films","StudioCanal","Arcade Pictures"],"production_companies":[{"name":"CBS Films"},{"name":"StudioCanal"},{"name":"Arcade Pictures"}],"cast":["Ashley Bell","Julia Garner","Andrew Sensenig","Spencer Treat Clark","Judd Lormand"],"backdrop_path":"https://image.tmdb.org/t/p/original/cQE2dSKpt31WNtiRipbYBlJz5YE.jpg","poster_path":"https://image.tmdb.org/t/p/original/kCvlw46oeHMDZKHt0bUv3v1gNc9.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
"8860":{"id":"8860","name":"O Negociador","slug":"o-negociador","original_title":"Metro","overview":"Em São Francisco, Scott Roper (Eddie Murphy) trabalha como negociador de reféns e enquanto tudo corre bem (dentro do possível) na sua vida profissional. Mas sua vida particular não é bem assim, pois Ronnie (Carmen Ejogo), sua ex-namorada, está saindo com um famoso jogador de baseball. Mas tudo piora realmente quando um oficial de polícia é assassinado por um ladrão de jóias psicótico, fazendo com que Roper fique decidido em fazer qualquer coisa para prender o criminoso, mesmo sendo ele proibido de entrar no caso por estar emocionalmente envolvido. Simultaneamente, ele tem de treinar um membro da SWAT para se tornar um negociador como ele, mas mesmo assim consegue prender o ladrão que matou seu amigo. Porém, tudo está longe de ficar tranquilo, pois o psicopata foge da prisão, sequestra Ronnie, que tinha reatado com Scott, e para devolvê-la exige que Roper entregue dez milhões de dólares em jóias, as que ele tinha roubado.","first_air_date":"1997-01-16","runtime":117,"episode_run_time":[117],"vote_average":5.7,"created_by":["Caravan Pictures","Touchstone Pictures"],"production_companies":[{"name":"Caravan Pictures"},{"name":"Touchstone Pictures"}],"cast":["Eddie Murphy","Kim Miyori","Art Evans","James Carpenter","Michael Rapaport"],"backdrop_path":"https://image.tmdb.org/t/p/original/vyUpTbQML0jEYWpMdbVtvM1LehE.jpg","poster_path":"https://image.tmdb.org/t/p/original/qL8CO0vq3cpmqj4IjSGivBMByIb.jpg","certification":"N/A","genres":["Ação","Aventura","Comédia","Crime","Thriller"],"trailer":"N/A"},
