"43549":{"id":"43549","name":"Detenção","slug":"detencao","original_title":"The Experiment","overview":"O desempregado Travis se inscreve em um experimento psicológico, no qual os participantes assumem as identidades dos presos e agentes penitenciários em um presídio vazio, com o pagamento de mil dólares por dia. Um dos participantes, Barris, abraça seu papel de agente penitenciário com espírito de vingança e em pouco tempo os presos se encontram à mercê de seus guardiões. Todos os indivíduos do teste descobrem como violência e crueldade podem facilmente se manifestar no comportamento humano.","first_air_date":"2010-07-15","runtime":96,"episode_run_time":[96],"vote_average":6.4,"created_by":["Stage 6 Films","Inferno Entertainment","Cinedigm","Magnet Media Productions","Magnet Media Group","Adelstein-Parouse Productions","Mercator Pictures","Natural Selection","Westeast Films"],"production_companies":[{"name":"Stage 6 Films"},{"name":"Inferno Entertainment"},{"name":"Cinedigm"},{"name":"Magnet Media Productions"},{"name":"Magnet Media Group"},{"name":"Adelstein-Parouse Productions"},{"name":"Mercator Pictures"},{"name":"Natural Selection"},{"name":"Westeast Films"}],"cast":["Adrien Brody","Cam Gigandet","Forest Whitaker","Maggie Grace","Clifton Collins Jr."],"backdrop_path":"https://image.tmdb.org/t/p/original/dKJM7ASnbe2owv92S4OwtqBG8wl.jpg","poster_path":"https://image.tmdb.org/t/p/original/98Z8KZ7kVgU47k709OGvrfCRgIo.jpg","certification":"N/A","genres":["Thriller","Drama"],"trailer":"N/A"},
"526051":{"id":"526051","name":"Não Olhe","slug":"nao-olhe","original_title":"Look Away","overview":"Uma tímida e reclusa estudante de 18 anos do ensino médio é alienada por seus pais e impiedosamente rejeitada por seus colegas. Desesperada e isolada, ela confia em seu próprio reflexo - e no espelho ela encontra seu gêmeo maligno imaginado, alguém que a apóia, encoraja e conhece todos os seus desejos secretos. Quando as “garotas” trocam de lugar, a sexualidade reprimida e uma violência feroz explodem com uma perigosa sensação de liberdade.","first_air_date":"2018-10-12","runtime":103,"episode_run_time":[103],"vote_average":6.5,"created_by":["Buffalo Gal Pictures","Primary Wave Entertainment","Dana Lustig Productions","MFM","Ace in the Hole Productions","Voltage Pictures"],"production_companies":[{"name":"Buffalo Gal Pictures"},{"name":"Primary Wave Entertainment"},{"name":"Dana Lustig Productions"},{"name":"MFM"},{"name":"Ace in the Hole Productions"},{"name":"Voltage Pictures"}],"cast":["India Eisley","Jason Isaacs","Mira Sorvino","Penelope Mitchell","John C. MacDonald"],"backdrop_path":"https://image.tmdb.org/t/p/original/x04SgdgxFGeNk2SLUnv9aXEuzQT.jpg","poster_path":"https://image.tmdb.org/t/p/original/9YTo6qopN0ACZ1dDSWnN6A743mi.jpg","certification":"N/A","genres":["Terror","Thriller","Fantasia"],"trailer":"N/A"},
"181009":{"id":"181009","name":"Salvando O General Yang","slug":"salvando-o-general-yang","original_title":"忠烈楊家將","overview":"Os contos da heroica família Yang tem sido material de lendas. Abrangendo várias gerações, as façanhas militares dos Yangs são consideradas o epítome da fraternidade, coragem e lealdade à família. Como resultado, suas histórias foram adaptadas para muitas séries populares de televisão e filmes ao longo dos anos, tornando-se uma das famílias mais famosas da cultura chinesa. O resgate de Yang Ye por seus sete filhos é agora objeto deste mais recente filme do diretor Ronny Yu (Mestre das Armas).","first_air_date":"2013-04-03","runtime":102,"episode_run_time":[102],"vote_average":6.3,"created_by":["Pegasus Motion Pictures"],"production_companies":[{"name":"Pegasus Motion Pictures"}],"cast":["鄭少秋","鄭伊健","吳尊","周渝民","徐帆"],"backdrop_path":"https://image.tmdb.org/t/p/original/wle8YjQAHKnxCkUi3imd06FUTv.jpg","poster_path":"https://image.tmdb.org/t/p/original/g2USBgZxPVbJxzWNejr9NVxR9AC.jpg","certification":"N/A","genres":["Ação","Aventura","História"],"trailer":"N/A"},
