"2064":{"id":"2064","name":"Enquanto Você Dormia","slug":"enquanto-voce-dormia","original_title":"While You Were Sleeping","overview":"Uma solitária funcionária do metrô de Chicago tem fantasias sobre um passageiro habitual que nunca falou com ela. Um dia ele é assaltado e jogado nos trilhos do metrô. Ela o salva, mas ele fica em coma e quando ela vai visitá-lo no hospital acaba sendo confundida como a noiva da vítima. Se a situação se complica por um lado por outro ela passa a ter novamente uma família para cuidar dela, algo que não sentia há muito tempo, e ao mesmo tempo começa a se apaixonar pelo irmão da vítima.","first_air_date":"1995-04-21","runtime":103,"episode_run_time":[103],"vote_average":7.0,"created_by":["Caravan Pictures","Hollywood Pictures"],"production_companies":[{"name":"Caravan Pictures"},{"name":"Hollywood Pictures"}],"cast":["Sandra Bullock","Bill Pullman","Peter Gallagher","Peter Boyle","Jack Warden"],"backdrop_path":"https://image.tmdb.org/t/p/original/lSAHLkXufrMWoQzcOYauR8q7Pci.jpg","poster_path":"https://image.tmdb.org/t/p/original/hid0NixxCPkoIxTisp82eq3xW7J.jpg","certification":"12","genres":["Romance","Comédia"],"trailer":"N/A"},
"38117":{"id":"38117","name":"A Fera","slug":"a-fera","original_title":"Beastly","overview":"Kyle é um jovem bem-sucedido e cobiçado pelas mulheres, mas ao tentar humilhar Kendra, ela lança uma maldição que o deixa com o rosto deformado. Envergonhado, ele passa a viver isolado com a companhia de uma empregada e um professor cego contratado para lhe dar aulas. Para quebrar o feitiço, Kyle tem de fazer com que uma mulher consiga amá-lo de verdade. Ele volta a ter esperanças quando se aproxima de Lindy, uma colega da escola.","first_air_date":"2011-01-21","runtime":86,"episode_run_time":[86],"vote_average":6.3,"created_by":["Storefront Films","CBS Films"],"production_companies":[{"name":"Storefront Films"},{"name":"CBS Films"}],"cast":["Alex Pettyfer","Vanessa Hudgens","Mary-Kate Olsen","LisaGay Hamilton","Neil Patrick Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/hU4OdICqRXj3JFnSJsrR0SJejZy.jpg","poster_path":"https://image.tmdb.org/t/p/original/hoTtnHIubjpigmUPXNZc5V97Q6X.jpg","certification":"PG-13","genres":["Romance","Fantasia","Drama"],"trailer":"QqSgrK8lLl0"},
"8840":{"id":"8840","name":"Coração de Dragão","slug":"coracao-de-dragao","original_title":"DragonHeart","overview":"No século X, durante uma revolta de camponeses, o rei, um terrível tirano, morre nos combates. Seu filho, um jovem príncipe, presencia tudo, além de ser gravemente ferido. A rainha, vendo o estado do filho, invoca o poder mágico de um dragão para salvá-lo, mas este só concorda em socorrê-lo dividindo o seu coração quando o príncipe jura que será bom e justo. No entanto, ele se torna um rei mais perverso que o pai e um jovem cavaleiro acredita que foi o coração do dragão que modificou o príncipe. Assim, decide eliminar todos os dragões, mas quando falta apenas um para ser morto o cavaleiro passa a ter uma visão real dos fatos.","first_air_date":"1996-05-31","runtime":103,"episode_run_time":[103],"vote_average":6.5,"created_by":["Universal Pictures"],"production_companies":[{"name":"Universal Pictures"}],"cast":["Dennis Quaid","Sean Connery","David Thewlis","Dina Meyer","Pete Postlethwaite"],"backdrop_path":"https://image.tmdb.org/t/p/original/9pNnSckOTQLQ5crNawV8guuHTqY.jpg","poster_path":"https://image.tmdb.org/t/p/original/yynXAb564y7g6d71arK3C4jcffl.jpg","certification":"N/A","genres":["Fantasia","Ação","Aventura","Drama"],"trailer":"N/A"},
"736732":{"id":"736732","name":"Broker - Uma Nova Chance","slug":"broker-uma-nova-chance","original_title":"브로커","overview":"Sang-hyeon (Song Kang-ho) é o proprietário da laundromat e voluntários numa igreja, onde seu amigo Dong-soo (Gang Dong-won) trabalha. Os dois administram um negócio ilegal juntos, ocasionalmente roubando bebês da deixados na igreja com Dong-soo, que exclui as imagens de vigilância da igreja. Eles vendem os bebês no mercado negro de adoção. Mas quando uma jovem mãe So-young (Lee Ji-eun) volta depois de ter abandonado seu bebê, ela os descobre e decide ir com eles em uma viagem para entrevistar os pais em potencial . Enquanto duas detetives, Soo-jin e Lee, estão investigando.","first_air_date":"2022-06-08","runtime":129,"episode_run_time":[129],"vote_average":7.2,"created_by":["Zip Cinema","CJ Entertainment"],"production_companies":[{"name":"Zip Cinema"},{"name":"CJ Entertainment"}],"cast":["Kang-ho Song","강동원","배두나","아이유","이주영"],"backdrop_path":"https://image.tmdb.org/t/p/original/dom8lzl2iU46nDu6s4lBolBNjQs.jpg","poster_path":"https://image.tmdb.org/t/p/original/dUtfx2WjylLAC1c9JeugIX2mP2c.jpg","certification":"N/A","genres":["Drama","Comédia","Crime"],"trailer":"N/A"},
