"10339":{"id":"10339","name":"Moby Dick","slug":"moby-dick","original_title":"Moby Dick","overview":"Consumido por uma raiva completamente insana, Capitão Ahab (Gregory Peck) tem apenas um objetivo na vida: Vingar-se de Moby Dick, a grande baleia branca que o feriu e desfigurou. O obcecado capitão de um baleeiro usa seu poder de comando como uma desculpa para navegar pelos Sete Mares em uma busca sem fim pelo seu objeto de ódio. Lutando contra uma tripulação amotinada, o calor tropical e tormentas violentas, Ahab finalmente encontra com sua inimiga e começa um confronto que irá culminar em uma luta épica de uma fúria sem fim…","first_air_date":"1956-06-27","runtime":116,"episode_run_time":[116],"vote_average":7.0,"created_by":["Moulin Productions Inc.","Warner Bros. Pictures"],"production_companies":[{"name":"Moulin Productions Inc."},{"name":"Warner Bros. Pictures"}],"cast":["Gregory Peck","Richard Basehart","Leo Genn","James Robertson Justice","Harry Andrews"],"backdrop_path":"https://image.tmdb.org/t/p/original/lbuYAwwTuqiWgpzlxMMPrYkUop4.jpg","poster_path":"https://image.tmdb.org/t/p/original/7JXcm3RyWlGsRCZ0YlOliWr6TNv.jpg","certification":"e 12","genres":["Aventura","Drama"],"trailer":"N/A"},
