"11017":{"id":"11017","name":"Billy Madison: Um Herdeiro Bobalhão","slug":"billy-madison-um-herdeiro-bobalhao","original_title":"Billy Madison","overview":"Billy é o filho irresponsável de Brian Madison, magnata de uma cadeia de hotéis. Ele tem 27 anos e só pensa em beber cerveja, ler revistas masculinas e se divertir com seus amigos tolos. O jovem espera herdar a fortuna da família, mas fica chocado ao saber que o pai determinou que ele não leva nada, a menos que conclua o segundo grau em 24 semanas. É uma missão bem difícil, já que Bill nunca passou da primeira série. Determinado a provar ao pai que é capaz, ele se matricula em uma escola.","first_air_date":"1995-02-10","runtime":90,"episode_run_time":[90],"vote_average":6.2,"created_by":["Jack Giarraputo Productions","Universal Pictures","Robert Simonds Productions"],"production_companies":[{"name":"Jack Giarraputo Productions"},{"name":"Universal Pictures"},{"name":"Robert Simonds Productions"}],"cast":["Adam Sandler","Bradley Whitford","Josh Mostel","Bridgette Wilson-Sampras","Darren McGavin"],"backdrop_path":"https://image.tmdb.org/t/p/original/5ESLsrW33Kw2c3GeLNHrG4Ef9M5.jpg","poster_path":"https://image.tmdb.org/t/p/original/dmMr7uoHKi6nYiPFod0Vl38XbwN.jpg","certification":"L","genres":["Comédia"],"trailer":"N/A"},
