"14560":{"id":"14560","name":"Segurança de Shopping","slug":"seguranca-de-shopping","original_title":"Paul Blart: Mall Cop","overview":"O chefe de família Paul Blart (Kevin James), trabalha como segurança em um shopping de New Jersey. Para além de excesso de peso, ele falhou no exame físico e não pode se tornar policial. Quando um grupo de criminosos ataca o centro comercial, Blart fica preso no local e opera como informante do Departamento de Polícia, além de trabalhar sozinho para deter os bandidos que estão ameaçando reféns.","first_air_date":"2009-01-15","runtime":91,"episode_run_time":[91],"vote_average":5.4,"created_by":["Hey Eddie","Columbia Pictures","Relativity Media","Sony Pictures","Happy Madison Productions"],"production_companies":[{"name":"Hey Eddie"},{"name":"Columbia Pictures"},{"name":"Relativity Media"},{"name":"Sony Pictures"},{"name":"Happy Madison Productions"}],"cast":["Kevin James","Keir O'Donnell","Jayma Mays","Raini Rodriguez","Shirley Knight"],"backdrop_path":"https://image.tmdb.org/t/p/original/eo1yKDfZioYBlAzw8XwHQhZF34J.jpg","poster_path":"https://image.tmdb.org/t/p/original/1cNfnzonc6tQ6Ej6cK4vxIE84tr.jpg","certification":"10","genres":["Ação","Aventura","Comédia","Família"],"trailer":"N/A"},
