"351901":{"id":"351901","name":"12 Rounds 3: Caçada Mortal","slug":"12-rounds-3-cacada-mortal","original_title":"12 Rounds 3: Lockdown","overview":"Shaw, um detetive que volta a ativa após a morte de seu parceiro. Quando ele descobre evidencias ligando seus ex-companheiros de polícia à um assassinato, eles acabam prendendo Shaw por um homicídio que ele não cometeu. Aprisionado em seu próprio distrito, Shaw irá fazer qualquer coisa para expor os policiais corruptos e limpar seu nome. Com doze balas e apenas um tiro para a redenção, nada ficará no caminho de Shaw neste thriller cheio de ação.","first_air_date":"2015-09-11","runtime":90,"episode_run_time":[90],"vote_average":5.9,"created_by":["WWE Studios"],"production_companies":[{"name":"WWE Studios"}],"cast":["Jonathan Good","Roger Cross","Daniel Cudmore","Lochlyn Munro","Sarah Smyth"],"backdrop_path":"https://image.tmdb.org/t/p/original/xgZMrOPgZcy8FXFOSULoZYM6Ktd.jpg","poster_path":"https://image.tmdb.org/t/p/original/ztuunn8RppaemRgEFxF50ogEAIE.jpg","certification":"16","genres":["Ação","Thriller","Crime"],"trailer":"N/A"},
"581644":{"id":"581644","name":"Os Renegados","slug":"os-renegados","original_title":"The Misfits","overview":"Depois de ser recrutado por um grupo de ladrões não convencionais, o renomado criminoso Richard Pace se vê envolvido em um elaborado assalto a ouro, que promete ter implicações de longo alcance em sua vida e na vida de inúmeras outras pessoas.","first_air_date":"2021-06-03","runtime":94,"episode_run_time":[94],"vote_average":5.5,"created_by":["Kjam Media","RNG Entertainment","FilmGate Productions","Highland Film Group"],"production_companies":[{"name":"Kjam Media"},{"name":"RNG Entertainment"},{"name":"FilmGate Productions"},{"name":"Highland Film Group"}],"cast":["Pierce Brosnan","Tim Roth","Nick Cannon","Rami Jaber","Jamie Chung"],"backdrop_path":"https://image.tmdb.org/t/p/original/6FzuNrApEc71aJ3CwwkpadbNled.jpg","poster_path":"https://image.tmdb.org/t/p/original/vrYpppKn5UimPMwsuL8cM2aoFXL.jpg","certification":"18","genres":["Ação","Thriller"],"trailer":"N/A"},
