"333352":{"id":"333352","name":"Decisão de Risco","slug":"decisao-de-risco","original_title":"Eye in the Sky","overview":"O encontro de três perigosos terroristas em Nairobi, no Quênia, faz com que uma elaborada operação seja coordenada diretamente da Inglaterra. É lá que a coronel Katherine Powell e o general Frank Benson acompanham os movimentos dos alvos, através de um avião-drone. Inicialmente a operação seria para capturá-los, mas a descoberta de dois homens-bomba faz com que o objetivo mude para eliminá-los a qualquer custo. Inicia então um debate interno, envolvendo o lado militar e também o político, sobre como agir causando o mínimo possível de danos colaterais.","first_air_date":"2015-09-07","runtime":102,"episode_run_time":[102],"vote_average":7.0,"created_by":["Raindog Films","Entertainment One Features"],"production_companies":[{"name":"Raindog Films"},{"name":"Entertainment One Features"}],"cast":["Helen Mirren","Aaron Paul","Alan Rickman","Barkhad Abdi","Jeremy Northam"],"backdrop_path":"https://image.tmdb.org/t/p/original/6HRo6TUVcb0x9Rzq3h8rURvZMzf.jpg","poster_path":"https://image.tmdb.org/t/p/original/vX3WyIN0Sc2TcnbaQCc7Bm7WBZ6.jpg","certification":"14","genres":["Drama","Thriller","Guerra"],"trailer":"pHnHN2w_k3E"},
