"384798":{"id":"384798","name":"Comando Kill","slug":"comando-kill","original_title":"Kill Command","overview":"Comando Kill se passa num futuro próximo onde a sociedade coloca o homem para combater suas próprias máquinas assassinas. Contra esse pano de fundo, existe uma unidade de elite do exército que é deixada por um helicóptero remoto, num centro de treinamento isolado. O que começa como um exercício de treinamento simples para o Capitão Bukes e sua unidade, se torna numa batalha terrível contra a morte, conforme os fuzileiros navais descobrem que a ilha é invadida por um inimigo que transcende o conceito humano do mal.","first_air_date":"2016-05-13","runtime":99,"episode_run_time":[99],"vote_average":5.6,"created_by":["Bandito","Vertigo Films"],"production_companies":[{"name":"Bandito"},{"name":"Vertigo Films"}],"cast":["Vanessa Kirby","Thure Lindhardt","David Ajala","Tom McKay","Deborah Rosan"],"backdrop_path":"https://image.tmdb.org/t/p/original/bJzWrOYHu1kF4eUiEa1DX4OrQvi.jpg","poster_path":"https://image.tmdb.org/t/p/original/uWuoiLRAwFLof9GeEmHjqEVzDT3.jpg","certification":"N/A","genres":["Ação","Terror","Ficção científica","Thriller"],"trailer":"N/A"},
