"322240":{"id":"322240","name":"Virei um Gato","slug":"virei-um-gato","original_title":"Nine Lives","overview":"Tom Brand é um poderoso e arrogante empresário, que está obcecado com a ideia de construir o maior arranha-céu da América do Norte. O problema é que seu atual empreendimento, em construção em Nova York, sofre a concorrência de um prédio sediado em Chicago, que pode receber uma antena no teto apenas para superar a disputa. Paralelamente, Tom precisa comprar um presente para sua filha, Rebeca, já que o aniversário dela se aproxima. A garota há anos lhe pede um gato, mas Tom se recusa a comprá-lo porque odeia o animal. Sem encontrar outra alternativa, ele acaba indo na estranha loja de Felix Perkins, um encantador de gatos que lhe vende o Sr. Bola de Pêlos. Entretanto, uma disputa dentro de sua própria empresa faz com que Tom sofra um acidente e, repentinamente, tenha sua consciência transferida para o gato recém-comprado.","first_air_date":"2016-08-03","runtime":87,"episode_run_time":[87],"vote_average":5.8,"created_by":["Fundamental Films","EuropaCorp"],"production_companies":[{"name":"Fundamental Films"},{"name":"EuropaCorp"}],"cast":["Kevin Spacey","Jennifer Garner","Robbie Amell","Cheryl Hines","Mark Consuelos"],"backdrop_path":"https://image.tmdb.org/t/p/original/5HnHEodzdN7thQRMfncWdle8ybD.jpg","poster_path":"https://image.tmdb.org/t/p/original/fZXms7VBxpRZlJbunf2CRMW0hyJ.jpg","certification":"N/A","genres":["Fantasia","Comédia","Família"],"trailer":"s-56YfabjC8"},
