"592656":{"id":"592656","name":"Ligados Pelo Sangue","slug":"ligados-pelo-sangue","original_title":"Brothers by Blood","overview":"Na Cidade do Amor Fraterno, Peter Flood, de oito anos, observa sua irmã mais nova ser morta pela direção imprudente de seu vizinho. O pai de Peter, atormentado pela morte de sua filha, paga um preço alto quando busca vingança – e os resultados deixam feridas de gerações que não podem ser curadas. Trinta anos depois, um Peter adulto ainda luta com a culpa que sente pela morte de sua irmã. À medida que tenta se distanciar dos negócios da família, seu primo Michael fica cada vez mais poderoso na hierarquia do crime. Ligados por sangue, nenhum dos primos consegue fugir da violência quando são arrastados para um ciclo assustador de traição e vingança.","first_air_date":"2020-09-08","runtime":86,"episode_run_time":[86],"vote_average":5.8,"created_by":["Brookstreet Pictures","Killer Films","GapBusters","RTBF","Vertical"],"production_companies":[{"name":"Brookstreet Pictures"},{"name":"Killer Films"},{"name":"GapBusters"},{"name":"RTBF"},{"name":"Vertical"}],"cast":["Matthias Schoenaerts","Joel Kinnaman","Maika Monroe","Paul Schneider","Ryan Phillippe"],"backdrop_path":"https://image.tmdb.org/t/p/original/bjfoBpZ5qP71wrUwGCLTZ2tDtw8.jpg","poster_path":"https://image.tmdb.org/t/p/original/dyvC5WQoSt6NoW9mbuFurDyqAug.jpg","certification":"16","genres":["Crime"],"trailer":"N/A"},
