"245":{"id":"245","name":"Um Grande Garoto","slug":"um-grande-garoto","original_title":"About a Boy","overview":"Will Freeman (Hugh Grant) é um homem na faixa dos trinta anos metido a galã que inventa ter um filho apenas para poder ir às reuniões de pais solteiros, onde tem a oportunidade de conhecer mães também solteiras. Will sempre segue a mesma tática: vive com elas um rápido romance e quando elas começam a falar em compromisso ele acaba o namoro. Até que, em um de seus relacionamentos, Will conhece o jovem Marcus (Nicholas Hoult), um garoto de 12 anos que é completamente o seu oposto e tem muitos problemas em casa e na escola. Com o tempo Will e Marcus se envolvem cada vez mais, aprendendo que um pode ensinar muito ao outro.","first_air_date":"2002-04-26","runtime":101,"episode_run_time":[101],"vote_average":6.7,"created_by":["Universal Pictures","StudioCanal","Working Title Films","Tribeca Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"StudioCanal"},{"name":"Working Title Films"},{"name":"Tribeca Productions"}],"cast":["Hugh Grant","Nicholas Hoult","Toni Collette","Rachel Weisz","Natalia Tena"],"backdrop_path":"https://image.tmdb.org/t/p/original/xxiPjhXigJ4zPiqqrA77FK10ULo.jpg","poster_path":"https://image.tmdb.org/t/p/original/38idKGSXqTUUMy0gqbUfmNOBhwh.jpg","certification":"N/A","genres":["Drama","Comédia","Romance"],"trailer":"N/A"},
"611605":{"id":"611605","name":"1BR: O Apartamento","slug":"1br-o-apartamento","original_title":"1BR","overview":"Quando Sarah se hospeda em um doce dormitório no Asilo Del Mar Apartments, em Los Angeles, ela acha que ganhou o jackpot. Tem muito espaço, inquilinos amigáveis, churrascos de grupo e até um vizinho bonitinho ao lado. Nem tudo é o que parece: barulhos altos começam a mantê-la acordada à noite; o gato dela está desaparecido; todo mundo parece ser um pouco prestativo e amigável, exceto o esquisito, Lester. Logo Sarah descobre que não escolheu este apartamento - ele a escolheu.","first_air_date":"2019-07-18","runtime":90,"episode_run_time":[90],"vote_average":6.0,"created_by":["Malevolent FIlms"],"production_companies":[{"name":"Malevolent FIlms"}],"cast":["Nicole Brydon Bloom","Giles Matthey","Taylor Nichols","Alan Blumenfeld","Naomi Grossman"],"backdrop_path":"https://image.tmdb.org/t/p/original/6CyILXa0BOm6HtV4naOjg5B2RRZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/aiYLasUoJXqOgJ9pnahDMELC9wf.jpg","certification":"N/A","genres":["Thriller","Drama","Terror"],"trailer":"N/A"},
"253450":{"id":"253450","name":"A Assassina","slug":"a-assassina","original_title":"刺客聶隱娘","overview":"No século VIII, durante a dinastia Tiang, Yinniang (Shu Qi) é uma assassina profissional, treinada com os melhores mestres. Ela é encarregada de matar um homem do governo, mas não consegue cumprir a tarefa quando o vê segurando um bebê recém-nascido. Punida por sua covardia, ela recebe a tarefa mais difícil de sua vida: matar o próprio primo, por quem é apaixonada, e com quem deveria se casar desde a adolescência. Yinniang tem que se confrontar ao passado para cumprir as ordens de sua mestra.","first_air_date":"2015-08-27","runtime":105,"episode_run_time":[105],"vote_average":6.4,"created_by":["Sil-Metropole Organisation","Media Asia Films","Central Motion Picture Corporation","Huace Film & TV","China Dream Film Culture Industry","SpotFilms","Wild Bunch"],"production_companies":[{"name":"Sil-Metropole Organisation"},{"name":"Media Asia Films"},{"name":"Central Motion Picture Corporation"},{"name":"Huace Film & TV"},{"name":"China Dream Film Culture Industry"},{"name":"SpotFilms"},{"name":"Wild Bunch"}],"cast":["舒淇","張震","謝欣穎","Sheu Fang-Yi","阮經天"],"backdrop_path":"https://image.tmdb.org/t/p/original/dHnY1f5I7CpjV4LMIjAz7LEnLRA.jpg","poster_path":"https://image.tmdb.org/t/p/original/swAJD9Uejz1C2HzkjBAhfT5VUO7.jpg","certification":"12","genres":["Drama","Ação","História"],"trailer":"N/A"},
