"662546":{"id":"662546","name":"Fada Madrinha","slug":"fada-madrinha","original_title":"Godmothered","overview":"Uma fada madrinha jovem e inexperiente embarca numa aventura por conta própria para provar seu valor rastreando uma jovem cujo pedido de ajuda foi ignorado. O que ela descobre é que a garota agora se tornou uma mulher adulta que precisa de algo muito diferente de um \"príncipe encantado\".","first_air_date":"2020-12-04","runtime":110,"episode_run_time":[110],"vote_average":6.7,"created_by":["Walt Disney Pictures","The Montecito Picture Company","Studio AKA"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"The Montecito Picture Company"},{"name":"Studio AKA"}],"cast":["Jillian Bell","Isla Fisher","Santiago Cabrera","Mary Elizabeth Ellis","Jane Curtin"],"backdrop_path":"https://image.tmdb.org/t/p/original/uztSaahK3bNVE5iZh4mRjHcCeii.jpg","poster_path":"https://image.tmdb.org/t/p/original/3NGfIT0w5twxgkvSTA7lQpW2K14.jpg","certification":"10","genres":["Família","Fantasia","Comédia"],"trailer":"KcsGwuc_q24"},
"1574":{"id":"1574","name":"Chicago","slug":"chicago","original_title":"Chicago","overview":"Velma Kelly (Catherine Zeta-Jones) é uma famosa dançarina que é também a principal atração da boate onde trabalha. Após matar seu marido, Velma entra em uma seleta lista de assassinas de Chicago, a qual é controlada por Billy Flynn (Richard Gere), um advogado que busca sempre se aproveitar ao máximo da situação. Ao contrário do que se esperava, o assassinato faz com que a fama de Velma cresça ainda mais, tornando-a uma verdadeira celebridade do showbizz. Enquanto isso, a aspirante a cantora Roxie Hart (Renée Zellweger) sonha com um mundo de glamour e fama, até que mata seu namorado após uma briga. Billy fica sabendo do crime e decide adiar ao máximo o julgamento de Velma, de forma a poder explorar os dois assassinatos ao máximo nos jornais. Assim como ocorreu com Velma, Roxie também se torna uma estrela por causa de crime que cometeu, iniciando uma disputa entre as duas pelo posto de maior celebridade do meio artístico.","first_air_date":"2002-12-10","runtime":113,"episode_run_time":[113],"vote_average":7.1,"created_by":["Miramax","The Producer Circle Co.","Storyline Entertainment"],"production_companies":[{"name":"Miramax"},{"name":"The Producer Circle Co."},{"name":"Storyline Entertainment"}],"cast":["Renée Zellweger","Catherine Zeta-Jones","Richard Gere","Queen Latifah","Ekaterina Chtchelkanova"],"backdrop_path":"https://image.tmdb.org/t/p/original/jkyqFgqmZlH5vSURckq0GgsewOY.jpg","poster_path":"https://image.tmdb.org/t/p/original/3ED8cWCXY9zkx77Sd0N5qMbsdDP.jpg","certification":"12","genres":["Comédia","Crime","Drama"],"trailer":"N/A"},
"354859":{"id":"354859","name":"A Promessa","slug":"a-promessa","original_title":"The Promise","overview":"Um triângulo amoroso surge em meio aos últimos dias do Império Otomano. Durante estes dias turbulentos, Michael (Oscar Isaac), um estudante de medicina excepcional, e Chris (Christian Bale), um renomado jornalista americano vão disputar o amor da bela Ana (Charlotte Le Bon).","first_air_date":"2016-12-02","runtime":133,"episode_run_time":[133],"vote_average":6.9,"created_by":["Babieka Films","Wonderful Films","Survivor Pictures","Open Road Films"],"production_companies":[{"name":"Babieka Films"},{"name":"Wonderful Films"},{"name":"Survivor Pictures"},{"name":"Open Road Films"}],"cast":["Oscar Isaac","Charlotte Le Bon","Christian Bale","Daniel Giménez Cacho","Tom Hollander"],"backdrop_path":"https://image.tmdb.org/t/p/original/sOgj0Kk22lQq40kn19u83JOEZRS.jpg","poster_path":"https://image.tmdb.org/t/p/original/pPMwAgYd1cZo3DtdEZuqwiBHybu.jpg","certification":"N/A","genres":["História","Romance","Drama"],"trailer":"N/A"},
"14854":{"id":"14854","name":"McQuade: O Lobo Solitário","slug":"mcquade-o-lobo-solitario","original_title":"Lone Wolf McQuade","overview":"O lendário Ranger do Texas renegado J.J. McQuade é terrível com a arma - mas letal com o seu cinturão negro! Quando a vida da sua filha adolescente é ameaçada por ladrões de estrada na tentativa de roubarem um camião cheio de armas e munições, o serviço torna-se pessoal para McQuade. Pondo a descoberto uma operação de tráfico e venda ilegal de armas a terroristas um pouco por todo o mundo, McQuade fica frente a frente com o rei desta rede gigantesca, Rawley - um nome afamado mundialmente nas artes marciais, por nunca ter perdido um combate! Terá o Ranger o que é necessário para salvar a filha e a honra - ou será que finalmente encontrou um adversário à altura, e consequentemente... a sua própria derrota?","first_air_date":"1983-04-15","runtime":106,"episode_run_time":[106],"vote_average":6.5,"created_by":["1818","Lone Wolf McQuade Associates","Topkick Productions","Orion Pictures"],"production_companies":[{"name":"1818"},{"name":"Lone Wolf McQuade Associates"},{"name":"Topkick Productions"},{"name":"Orion Pictures"}],"cast":["Chuck Norris","David Carradine","Barbara Carrera","Leon Isaac Kennedy","Robert Beltran"],"backdrop_path":"https://image.tmdb.org/t/p/original/8MAhWT95ZW0t3DMPvJ0ehAsSzPm.jpg","poster_path":"https://image.tmdb.org/t/p/original/ddsKrcL7iiK66cJyj3JVyZKdm2q.jpg","certification":"N/A","genres":["Ação","Crime"],"trailer":"N/A"},
