"14819":{"id":"14819","name":"Pesos Pesados","slug":"pesos-pesados","original_title":"Heavyweights","overview":"Gerry Garner, um pré-adolescente um pouco acima do peso, é mandado para um acampamento destinado a crianças gordinhas como ele. A promessa era que as férias de verão seriam divertidas, mas, quando chega no acampamento, ele e seus colegas descobrem que seu monitor será um verdadeiro maluco por dietas e exercícios.","first_air_date":"1995-02-17","runtime":100,"episode_run_time":[100],"vote_average":6.2,"created_by":["Walt Disney Pictures","Caravan Pictures"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Caravan Pictures"}],"cast":["Tom McGowan","Aaron Schwartz","Shaun Weiss","Tom Hodges","Leah Lail"],"backdrop_path":"https://image.tmdb.org/t/p/original/wwqgUQmbiHFjYWvjLgUXTCTCgZs.jpg","poster_path":"https://image.tmdb.org/t/p/original/9asfY7y9qhonc888JdTrYRNXjE8.jpg","certification":"L","genres":["Família","Comédia"],"trailer":"N/A"},
