"9778":{"id":"9778","name":"Escrito nas Estrelas","slug":"escrito-nas-estrelas","original_title":"Serendipity","overview":"Num apressado dia de compras no inverno de 1990, Jonathan Trager (John Cusack) conhece Sara Thomas (Kate Beckinsale). Dois estranhos no meio da massa em NY, seus caminhos se cruzam em um feriado, sendo que logo sentem entre eles uma atração mútua. Apesar do fato de ambos estarem envolvidos em outras relações, Jonathan e Sara passam a noite andando por Manhattan. Quando a noite chega ao fim, os dois são forçados a determinar algo como seu próximo passo. Quando Jonathan sugere uma troca de telefones, Sara rejeita e propõe uma idéia que dará ao destino o controle de seu futuro. Se eles tiverem que ficar juntos, ela diz a ele, eles encontrarão o caminho de volta para a vida um do outro.","first_air_date":"2001-10-05","runtime":90,"episode_run_time":[90],"vote_average":6.9,"created_by":["Tapestry Films","Miramax","Simon Fields Productions"],"production_companies":[{"name":"Tapestry Films"},{"name":"Miramax"},{"name":"Simon Fields Productions"}],"cast":["John Cusack","Kate Beckinsale","Jeremy Piven","Bridget Moynahan","John Corbett"],"backdrop_path":"https://image.tmdb.org/t/p/original/gU7EMTMV3d2ykb9630PAwLSvtSz.jpg","poster_path":"https://image.tmdb.org/t/p/original/kD0U1dENdFpbTm6cIWIkZOqKMkB.jpg","certification":"N/A","genres":["Comédia","Romance","Drama"],"trailer":"N/A"},
"262":{"id":"262","name":"O Rei da Comédia","slug":"o-rei-da-comedia","original_title":"The King of Comedy","overview":"Um dia, quando está a caminho do estúdio, algo engraçado acontece com o anfitrião de TV Jerry Langford: Ele é sequestrado pelo aspirante a comediante Rupert Pupkin e por sua tresloucada amiga Masha. Langford então é forçado a dar uma chance a Pupkin, permitindo que ele apresente seu número no show. O que se segue é uma história incrivelmente engraçada e introspectiva sobre o lado negro da comédia.","first_air_date":"1982-12-18","runtime":109,"episode_run_time":[109],"vote_average":7.8,"created_by":["Embassy International Pictures","20th Century Fox"],"production_companies":[{"name":"Embassy International Pictures"},{"name":"20th Century Fox"}],"cast":["Robert De Niro","Jerry Lewis","Diahnne Abbott","Sandra Bernhard","Shelley Hack"],"backdrop_path":"https://image.tmdb.org/t/p/original/npoUm3stzUM2lR46ClLDwBZDaeZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/bdCJM9YbYbcphpWHz8gvRuMRR9J.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
"26264":{"id":"26264","name":"George, o Rei da Floresta 2","slug":"george-o-rei-da-floresta-2","original_title":"George of the Jungle 2","overview":"George está de volta em uma nova aventura. A sogra de George, Beatrice Stanhope, não quer que Ursula, sua filha, fique zanzando com o rei das selvas. Ela e Lyle, ex-noivo de Ursula, conspiram um plano para separá-los: hipnotizam Ursula e a obrigam a deixar George para sempre. Você vai dar boas risadas com esta turma divertida do Rei das Selvas.","first_air_date":"2003-08-18","runtime":87,"episode_run_time":[87],"vote_average":4.4,"created_by":["Kerner Entertainment Company","Walt Disney Home Video"],"production_companies":[{"name":"Kerner Entertainment Company"},{"name":"Walt Disney Home Video"}],"cast":["Christopher Showerman","Julie Benz","Angus T. Jones","Thomas Haden Church","Christina Pickles"],"backdrop_path":"https://image.tmdb.org/t/p/original/8FwLEl7WNO2vTn6ZVukKFgpwJlz.jpg","poster_path":"https://image.tmdb.org/t/p/original/kP9hHoY8DfpRn0uO9jQW07fugfo.jpg","certification":"N/A","genres":["Aventura","Comédia","Família"],"trailer":"N/A"},
"9622":{"id":"9622","name":"Um Ninja da Pesada","slug":"um-ninja-da-pesada","original_title":"Beverly Hills Ninja","overview":"Depois do naufrágio de um barco, um bebê é resgatado por um clã de ninjas guerreiros e cuidado como um deles. Mas Haru (Chris Farley), apesar de se empenhar ao máximo para se tornar um ninja merecedor, não se encaixa. Entretanto, o perseverante e bondoso Haru, em seu jeito empavonado, recebe uma missão que o traz para Beverly Hills, onde terá que investigar um assassinato misterioso.","first_air_date":"1997-01-17","runtime":88,"episode_run_time":[88],"vote_average":5.7,"created_by":["Motion Picture Corporation of America","TriStar Pictures"],"production_companies":[{"name":"Motion Picture Corporation of America"},{"name":"TriStar Pictures"}],"cast":["Chris Farley","Nicollette Sheridan","Robin Shou","Nathaniel Parker","Chris Rock"],"backdrop_path":"https://image.tmdb.org/t/p/original/9A0MSMSF9BzjTsVRuAO9crT8Oto.jpg","poster_path":"https://image.tmdb.org/t/p/original/eqEJ16k6h2w8eojrRbN1UX2mAIu.jpg","certification":"N/A","genres":["Comédia","Ação"],"trailer":"N/A"},
