"1120628":{"id":"1120628","name":"Hormônios à Flor da Pele","slug":"hormonios-a-flor-da-pele","original_title":"Hammerharte Jungs","overview":"Enquanto tentam sobreviver ao ensino médio, Charly e Paula vivem os hormônios à flor da pele e o medo de perder a amizade se revelarem o que sentem um pelo outro.","first_air_date":"2023-05-24","runtime":102,"episode_run_time":[102],"vote_average":5.8,"created_by":["Rat Pack Filmproduktion"],"production_companies":[{"name":"Rat Pack Filmproduktion"}],"cast":["Tobias Schäfer","Cosima Henman","Axel Stein","Diana Amft","Vivien König"],"backdrop_path":"https://image.tmdb.org/t/p/original/mqto2rCJcuXFHUkDNsLf3FF2qki.jpg","poster_path":"https://image.tmdb.org/t/p/original/xpDndQSw95YOIq5a3RSTo9ZZavw.jpg","certification":"16","genres":["Comédia"],"trailer":"N/A"},
"1083658":{"id":"1083658","name":"A Grande Entrevista","slug":"a-grande-entrevista","original_title":"Scoop","overview":"Inspirado em eventos reais, ‘Scoop’ é o relato interno do jornalismo corajoso que rendeu uma entrevista devastadora – a infame aparição do príncipe Andrew na BBC Newsnight. Da tensão das negociações de alto risco da produtora Sam McAlister com o Palácio de Buckingham, até o confronto forense de cair o queixo de Emily Maitlis com o Príncipe, ‘Scoop’ nos leva para dentro da história, com as mulheres que não parariam por nada para consegui-la. Para conseguir uma entrevista tão grande, você tem que ser ousado.","first_air_date":"2024-03-27","runtime":102,"episode_run_time":[102],"vote_average":6.4,"created_by":["The Lighthouse","Voltage TV"],"production_companies":[{"name":"The Lighthouse"},{"name":"Voltage TV"}],"cast":["Gillian Anderson","Billie Piper","Rufus Sewell","Keeley Hawes","Romola Garai"],"backdrop_path":"https://image.tmdb.org/t/p/original/c2vhEOVNoXeEXUkiLhBsP3mIcQe.jpg","poster_path":"https://image.tmdb.org/t/p/original/jUurIBIrzirFZErIp1XWgIxWZ9f.jpg","certification":"16","genres":["Drama"],"trailer":"5-29vlqgW-4"},
"105965":{"id":"105965","name":"Perdido pra Cachorro 3","slug":"perdido-pra-cachorro-3","original_title":"Beverly Hills Chihuahua 3","overview":"Junte-se a Papi e sua família de duas e quatro patas enquanto eles se instalam em um elegante hotel em Beverly Hills, que oferece um luxuoso SPA para cães. Mas há confusão no paraíso do cãozinho quendo Rosa, a menor integrante da turma sente-se insignificante e menos especial do que nunca. Agora, Papi precisa ajudar Rosa a encontrar – e celebrar – sua força interior, que acaba sendo maior do que ela jamais sonhara. Repleto de gargalhadas, romance e ação eletrizante, esta é uma diversão garantida de cabo a rabo para toda a família.","first_air_date":"2012-09-03","runtime":89,"episode_run_time":[89],"vote_average":6.3,"created_by":["Walt Disney Home Video"],"production_companies":[{"name":"Walt Disney Home Video"}],"cast":["George Lopez","Frances Fisher","Jake Busey","Emily Osment","Odette Annable"],"backdrop_path":"https://image.tmdb.org/t/p/original/h7WBvAHd6IqDsAycFWsqlcdt1i3.jpg","poster_path":"https://image.tmdb.org/t/p/original/hcvzgsNPoS2ImrSkWCRl2bxMdbA.jpg","certification":"L","genres":["Comédia","Família"],"trailer":"N/A"},
