"474354":{"id":"474354","name":"22 de Julho","slug":"22-de-julho","original_title":"22 July","overview":"Noruega, 2011. Anders Behring Breivik, consumido pelos seus ideias fundamentalistas cristãos e anti-islâmicos, mata 75 pessoas a tiros em um acampamento na Ilha de Utoya. Os sobreviventes do ataque pedem justiça ao governo Norueguês, enquanto os advogados do terrorista condenado se mobilizam para defendê-lo perante a lei. Baseado em fatos reais.","first_air_date":"2018-10-04","runtime":133,"episode_run_time":[133],"vote_average":7.1,"created_by":["Scott Rudin Productions"],"production_companies":[{"name":"Scott Rudin Productions"}],"cast":["Jonas Strand Gravli","Anders Danielsen Lie","Jon Øigarden","Seda Witt","Ola G. Furuseth"],"backdrop_path":"https://image.tmdb.org/t/p/original/rKzHtW1bdboA89FwiyRBNTY7edc.jpg","poster_path":"https://image.tmdb.org/t/p/original/fO1YmU5DvYdudmODO25PpRekiMX.jpg","certification":"16","genres":["Crime","Drama","História","Thriller"],"trailer":"N/A"},
